import React, {useState} from 'react'

export default function Gallery(rects) {

    const [rect, setRect] = useState([])
    return (
        <div>
            <h1>Galeria</h1>
            <ul>
                {rects.map((rect) =>
                <li key = {rects.indexOf(rect)}>{rect}</li>)}
            </ul>
        </div>
    )
}
